import "../styles.css";
import { createGlobalStyle } from "styled-components";

const GlobalStyle = createGlobalStyle`
* {
    box-sizing: border-box;
    text-decoration: none;
    list-style: none;
}

body {
    margin: 0;
}

button {
    border: none;
}
`;

//this config enables global styles
function App({ Component, pageProps }) {
  return (
    <>
    </>
  );
}

export default App;
